V8:
NŞAATÇILAR metrosunun çıxışında Pilot lahiyyədə «Sky Residence» yaşayış kompleksində “ İrşad Electronics” magasının üstü.
Yeni tikilmiş tam yaşayışlı və Qazlı binada.
ÇİXARİŞ yaxın müddət ərzində veriləcək.
2 otaqlı təmirsiz-pod mayak mənzil satılır.
Ümumi sahəsi 75 kv.m. olan., mənzil 13 mərtəbəli binanın 13-cu mərtəbəsindədir.LİFT 13-cu mərtəbəsinə GALXIR!
Mənzilin ƏLA planlaşdırması var.
Müasir texniki təchizatlı və tam infrastrukturlu rahat binadır.Yeni kompleksin yaxınlığında uşaq bağçası, 13 saylı ümumtəhsil məktəbi, tibb mərkəzi yerləşir.Yanında bir çox bank şöbəsi, apteklər, üç yüz metr məsafədə isə ticarət mərkəzi yerləşir.Bina relyef dekorativ elementlərlə bəzədilmiş,hər blokda – bir sərnişin və bir yük səssiz, rahat liftlər;
müasir yanğın siqnalizasiya sistemi;
yüksək səviyyəli texnoloji avadanlıqla;
hər blok girişində domofonlarla təchiz olunmuşdur.Kompleksin ərazisi hasara alınıb, mühafizə xidməti və 24 saat videomüşahidə sistemi nəzərdə tutulub.

